create table Crypto (
                        id INT AUTO_INCREMENT,
                        sender_address VARCHAR(100),
                        receiver_address VARCHAR(100),
                        amount DECIMAL(9,2),
                        currency VARCHAR(50),
                        transaction_date DATE,
                        transaction_type VARCHAR(8),
                        transaction_status VARCHAR(9),
                        transaction_fee DECIMAL(5,2),
                        PRIMARY KEY (id)
);
